// RUN: objc3c -fobjc-version=3 --import-module DIAGGRP07Alpha.objcmod --import-module DIAGGRP07Beta.objcmod -fsyntax-only %s
#if defined(DIAGGRP07_MODULE_ALPHA)
const int SharedCounter = 1;
#elif defined(DIAGGRP07_MODULE_BETA)
const int SharedCounter = 2;
#else
@import Alpha;
@import Beta;
